Creates and returns an appropriate {@link ServiceProfile} for a UI service. This service is called from the main menu when the UI service is selected. Typically, the UI service that registers this ServiceProfile will then send a UI request to present the main dialog of the UI service. 
@link ServiceCallee#handleCall(ServiceCall)} is called, the {@link ServiceCall} will have this URI as process URI and can be retrieved by calling {@link ServiceCall#getProcessURI()}.
@return The created service profile that can be used to register the UI service at the service bus.

Gets the UI service description of the service. 
@link ServiceCaller} that will be used to issue the service request to get the information.
@return The description of the service profile.

